gTV(){return"\u2022 Among the factors that explain the variation in the mother's weight at birth, the main ones are nutrition during the gestational period (50%) and the mother's age (17%);\n \u2022 The main factors that influence variations in birth weight of calves are: mother's birth weight (26%), father's race (11%), calf's sex (5%); and, not considering the mother's weight at birth, 20% refers to maternal nutrition during pregnancy, 8% to the father's race, 6% to the mother's age and 4% to the calf's sex;\n \u2022 The main factors influencing changes in the baby's weaning weight are: mother's nutrition during lactation (41%), mother's weight at birth (14%), baby's age at weaning (6%), sex (5%) and birth weight (3%);\n \u2022 Among the factors influencing weight of the yearling animals, the following stand out: weaning weight (48%), birth weight (13%), sex (9%) and mother's age (2%).\n"},
