gG8(){return" Females in general"},
gHe(){return"Breeder Management"},
gTU(){return"\u2022 Apply selection pressure for fertility by discarding heifers and cows that do not conceive or calve at the end of the calving season;\n\n\u2022 Apply reproductive and ecto and endo parasitic vaccines before the mating season; avoid managing them as much as possible for up to one month after conception to reduce pregnancy losses;\n\n\u2022 Provide quality mineral salt throughout the year for the entire herd;\n\n\u2022 For cows with calf at the foot to have greater chances of repeat calving, they must calve with a body condition above 3 (1-5).\n"},
gWb(){return"\n\u2022 To obtain precocious females, start using breeders and sires genetically evaluated for precocity, pay attention to the birth weight of the sires;\n\n\u2022 Plan the feeding of the mother, a good protein and energy nutrition in the middle third of pregnancy will reflect on the reproductive performance of her progeny;\n\n\u2022 Higher weights at weaning of the heifers, values \u200b\u200babove 170Kg, will imply the need for smaller weight gains after weaning until mating;\n\n\u2022 The heifer must reach at least 55% of the adult weight of the cows in the herd to start mating;\n\n\u2022 Females, with a reproductive tract score above four (4) and body condition above three, are more likely to conceive in their first mating season;\n\n\u2022 Start mating heifers at least a month before the other categories, females giving birth early are more likely to repeat offspring.\n"},
gTS(){return"\nBREEDING SEASON\n"},
gTR(){return"\n\u2022 Establish the mating season and, consequently, calving according to the availability of food and the welfare of the animals;\n\n\u2022 Start the mating season when 4% of females show signs of heat per day;\n\n\u2022 In a 90-day mating season, in the first month, 60% of singles come into heat, 30% of heifers and cows with calf, less than 10%. These tend to concentrate their heat at the end of the season. This information is important for distributing the breeders throughout the season.\n"},
gXX(){return"\n\u2022 Use sires with genetic merit, either by artificial insemination or for transfer, in the latter case, they must pass the andrological exam and the libido test ;\n\n\u2022 Use sires of the same age and, preferably, the same management group in a ratio of 1:25, in the first 45 days of the mating season, this ratio may increase to 1:50 by the end; If the paddocks are of large size, use 6% of breeders;\n\n\u2022 Review the performance of breeders in the field: juveniles, daily, adults, two to three times a week; You can also identify the dominant individuals in the herd; \n\n\u2022 Assess body condition, especially young and old bull.\n\n\u2022 Always keep a reserve of 10 to 15% of suitable bulls on the farm, with a view to possible replacements;\n\n\u2022 Bulls from other farms need an adaptation period of at least 45 days.\n"},
gX8(){return"\n\u2022 Reserve a maternity paddock that allows greater control of the animals, with a good supply of forage, water and shade;\n\n\u2022 Try to concentrate calving on the first 42 days of the season;\n\n\u2022 Check if the dam was interested and caring for the newborn calf mainly among first-calf heifers;\n\n\u2022 Make sure the calf has suckled colostrum;\n\n\u2022 Dip the calf's navel with antiseptic solutions;\n\n\u2022 Record all occurrences related to calving such as: type of calving (normal or assisted), occurrence of  retained placenta, stillbirths, deformities, among others) and, if possible, weigh the calf and its dam within 24 hours of birth;\n\n\u2022 Start dosing with endoparasitic from 3 months of age and repeat every 2 months, remember that these animals need strategic deverminations up to 2 years of age at least.\n"},
