gTV(){return"\u2022 Entre os fatores que explicam a varia\xe7\xe3o do peso da m\xe3e ao parto, os principais s\xe3o a nutri\xe7\xe3o durante o per\xedodo gestacional (50%) e a idade da m\xe3e (17%);\n \u2022 Os principais fatores que influenciam as varia\xe7\xf5es do peso ao nascer dos bezerros s\xe3o: peso da m\xe3e ao parto (26%), ra\xe7a do pai (11%), sexo do bezerro (5%); e, n\xe3o considerando o peso da m\xe3e ao parto, 20% refer\xeancia-se a nutri\xe7\xe3o materna durante a gesta\xe7\xe3o, 8% \xe0 ra\xe7a do pai, 6% \xe0 idade da m\xe3e e 4% ao sexo do bezerro;\n \u2022 Os principais fatores que influenciam as varia\xe7\xf5es do peso ao desmame do beb\xea s\xe3o: nutri\xe7\xe3o da m\xe3e durante a lacta\xe7\xe3o (41%), peso da m\xe3e ao parto (14%), idade do beb\xea ao desmame (6%), sexo (5%) e peso ao nascer (3%);\n \u2022 Entre os fatores que influenciam o peso dos animais ao sobreano destacam-se: peso ao desmame (48%), peso ao nascer (13%), sexo (9%) e idade da m\xe3e (2%).\n"},
