gTU(){return"\u2022 Fa\xe7a press\xe3o de sele\xe7\xe3o para fertilidade descartando as novilhas e as vacas que n\xe3o conceberem ou que parirem no final da esta\xe7\xe3o de nascimento;\n \n\u2022 Aplique  vacinas reprodutivas e  ecto e endo parasit\xe1rios antes da esta\xe7\xe3o de acasalamento; evite ao m\xe1ximo manej\xe1-las at\xe9 um m\xeas ap\xf3s a concep\xe7\xe3o para reduzir perdas gestacionais;\n \n\u2022 Forne\xe7a sal mineral de qualidade durante o ano para todo o rebanho;\n \n\u2022 Para que vacas com cria ao p\xe9 tenham maiores chances de repetir cria, devem parir com uma condi\xe7\xe3o corporal acima de 3 (1-5).\n"},
gWb(){return"\n\u2022 Para obter f\xeameas precoces, inicie utilizando matrizes e reprodutores avaliados geneticamente para precocidade, fique atento ao peso ao nascer dos reprodutores;\n\n\u2022 Planeje a alimenta\xe7\xe3o da matriz, uma boa nutri\xe7\xe3o prot\xe9ica e energ\xe9tica no ter\xe7o m\xe9dio da gesta\xe7\xe3o refletir\xe1 no desempenho reprodutivo de sua prog\xeanie;\n\n\u2022 Maiores pesos ao desmame das bezerras, valores acima de 170Kg, implicar\xe1 em necessidade de menores ganhos de peso no p\xf3s-desmame at\xe9 o acasalamento;\n\n\u2022 A novilha dever\xe1 atingir no m\xednimo 55% do peso adulto das vacas do rebanho para iniciar o acasalamento;\n\n\u2022 F\xeameas, com escore do trato reprodutivo acima de quatro (4) e condi\xe7\xe3o corporal acima de tr\xeas, t\xeam maiores chances de  conceber em sua primeira esta\xe7\xe3o de acasalamento;\n\n\u2022 Inicie o acasalamento das novilhas pelo menos um m\xeas antes das demais categorias, f\xeameas parindo cedo t\xeam maiores chances de repetir cria.\n"},
gTS(){return"\nESTA\xc7\xc3O DE ACASALAMENTO\n"},
gTR(){return"\n\u2022 Estabele\xe7a a esta\xe7\xe3o de acasalamento e, consequente,  pari\xe7\xe3o conforme a disponibilidade de alimentos e o bem-estar dos animais;\n\n\u2022 Inicie a esta\xe7\xe3o de acasalamento quando 4 % das f\xeameas apresentarem sinais de cio ao dia;\n\n\u2022 Em uma esta\xe7\xe3o de acasalamento de 90 dias, no primeiro m\xeas, 60% das f\xeameas solteiras entram em cio, 30% das novilhas e as vacas com cria ao p\xe9, menos de 10%. Estas \xfaltimas tendem a concentrar seus cios ao final da esta\xe7\xe3o. Esta informa\xe7\xe3o \xe9 importante para fazer a distribui\xe7\xe3o dos reprodutores ao longo da esta\xe7\xe3o.\n"},
gXX(){return"\n \u2022 Utilize reprodutores com m\xe9rito gen\xe9tico, seja pela insemina\xe7\xe3o artificial ou para repasse, neste \xfaltimo caso, devem ser aprovados no exame androl\xf3gico e no teste de libido;\n\n\u2022 Utilize reprodutores de mesma idade e, preferencialmente, mesmo grupo de manejo na propor\xe7\xe3o de 1:25, nos primeiros 45 dias da esta\xe7\xe3o de acasalamento, podendo esta rela\xe7\xe3o passar para 1:50 at\xe9 o final; Se os potreiros forem de grande tamanho, utilize 6% de reprodutores;\n\n\u2022 Revise o desempenho dos reprodutores a campo: jovens, diariamente, adultos, duas a tr\xeas vezes por semana; Pode-se tamb\xe9m identificar os indiv\xedduos dominantes no lote; \n\n\u2022 Avalie a condi\xe7\xe3o corporal, principalmente os  jovens e os de idade avan\xe7ada;\n\n\u2022 Sempre mantenha uma reserva de 10 a 15% de reprodutores aptos na propriedade, visando eventuais substitui\xe7\xf5es;\n\n\u2022 Reprodutores oriundos de outras propriedades necessitam de um per\xedodo de adapta\xe7\xe3o de no m\xednimo 45 dias.\n"},
gX8(){return"\n\u2022 Reserve um potreiro maternidade que permita um controle maior dos animais, com boa oferta de forragem, \xe1gua e sombra;\n\n\u2022 Procure concentrar os partos nos primeiros 42 dias da esta\xe7\xe3o;\n\n\u2022 Verifique se a m\xe3e teve interesse e cuidados com o rec\xe9m-nascido; principalmente entre as novilhas de primeira cria;\n\n\u2022 Certifique-se que o bezerro mamou o colostro;\n\n\u2022 Trate o umbigo do bezerro com solu\xe7\xf5es antiss\xe9pticas;\n\n\u2022 Registre todas as ocorr\xeancias relacionadas \xe0 pari\xe7\xe3o, como: tipo de parto (normal ou assistido), ocorr\xeancia de reten\xe7\xe3o de placenta, de natimortos, de deformidades, entre outros) e se poss\xedvel pese o bezerro e sua m\xe3e at\xe9 24 horas ap\xf3s o nascimento;\n\n\u2022 Inicie as dosifica\xe7\xf5es com endoparasit\xe1rios a partir dos 3 meses de vida e repita a cada 2 meses, lembre-se que estes animais necessitam desvermina\xe7\xf5es estrat\xe9gicas at\xe9 os 2 anos de idade no m\xednimo.\n"},
